export default function Footer(props) {
  return (
    <div className='row fixed-bottom bg-dark text-white text-center apniCss'>
        <div className="col-2 bg-danger">Cancel</div>
        <div className="col-8">{props.productList[0].Price*props.productList[0].Quantity + props.productList[1].Price*props.productList[0].Quantity}</div>
        <div className='col-2 bg-success'>Pay</div>
    </div>
  )
}
